import React, { useState } from 'react';
import Navbar from '../components/navbar';
import Footer from '../components/footerComponent';

function Events() {
  const [activeTab, setActiveTab] = useState('all');

  const renderTabContent = () => {
    switch (activeTab) {
      case 'all':
        return (
          <div className={`tab-pane ${activeTab === 'all' ? 'active' : ''}`} id="all" role="tabpanel" aria-labelledby="all-tab">
            <div className="banner-carousel">Banner - carousel</div>
            <h3 className="mt-4">Past Events</h3>
            {/* ... rest of the content ... */}
          </div>
        );
      case 'reunions':
        return (
          <div className={`tab-pane ${activeTab === 'reunions' ? 'active' : ''}`} id="reunions" role="tabpanel" aria-labelledby="reunions-tab">
            <img src="path_to_image" className="img-fluid mt-4" alt="Reunion" />
            <h3 className="mt-4">Past Reunions</h3>
            {/* ... rest of the content ... */}
          </div>
        );
      case 'webinars':
        return (
          <div className={`tab-pane ${activeTab === 'webinars' ? 'active' : ''}`} id="webinars" role="tabpanel" aria-labelledby="webinars-tab">
            <img src="path_to_image" className="img-fluid mt-4" alt="Webinar" />
            <h3 className="mt-4">Past Webinars</h3>
            {/* ... rest of the content ... */}
          </div>
        );
      default:
        return null;
    }
  };

  return (
    <div>
      <Navbar />
      <div className="container my-4">
        <h1 className="mb-4">Events</h1>
        <p>View upcoming and previous alumni events & conferences from Sunbeam</p>
        <ul className="nav nav-tabs" id="myTab" role="tablist">
          {/* ... rest of the tab navigation ... */}
        </ul>
        <div className="tab-content">
          {renderTabContent()}
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default Events;
